INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 2, 321, 40011, 0, 24001, "リリ", 125801, 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 2, 322, 40011, 0, 24001, "クリア", 126001, 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "んーと。\nこれ、あげる。\nはい", 3, 2, 323, 40011, 0, 24001, "プレシア", 126101, 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 4, 2, 324, 40011, 0, 24001, "リリ", 125801, 2);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, 2, 325, 40011, 0, 24001, "クリア", 126001, 2);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "お兄。\nきてくれて、うれしい", 6, 2, 326, 40011, 0, 24001, "プレシア", 126101, 2);
